import React from 'react';
import { useHistory } from 'react-router-dom';
import {useSelector} from "react-redux";

const Auth = () => {
    const history = useHistory()
    const {isAuth} = useSelector(state => state.userReducer)

    if (isAuth) {
        history.push('/')
    }

    return (
        <div>
            AUTH
        </div>
    );
};

export default Auth;
